func Test_contractInspector_InspectContract(t *testing.T) {

	//mainnetConfig, _ := boc.DeserializeBocBase64(mainnetConfig)
	//testnetConfig, _ := boc.DeserializeBocBase64(testnetConfig)

	tests := []struct {
		name           string
		code           string
		account        string
		data           string
		hasLibrary     bool
		emulatorConfig *boc.Cell
		want           []ContractInterface
		wantValidate   func(d *ContractDescription) error
	}{
		{
			name:    "cocoon root",
			account: "EQCns7bYSp0igFvS1wpb5wsZjCKCV19MD5AVzI4EyxsnU73k",
			code:    "",
			data:    "",
			want: []ContractInterface{
				TonCocoonRoot,
			},
		},
		{
			name:    "cocoon proxy",
			account: "EQCZF7z1shg8z-IiOJCYQ7GgIUHDwPidsdwuWd7j12UToPOK",
			code:    "",
			data:    "",
			want: []ContractInterface{
				TonCocoonProxy,
			},
		},
		{
			name:    "cocoon client",
			account: "EQCIPXuSCiC7qohgSP-nTsUCYmCHBbWLts7Cgpe7YqN6qL98",
			code:    "",
			data:    "",
			want: []ContractInterface{
				TonCocoonClient,
			},
		},
		{
			name:    "cocoon worker",
			account: "EQBLNAwS0I3XwiAMcSgTkPjRFA05iSzgZBuo6gpddqI9pFT4",
			code:    "",
			data:    "",
			want: []ContractInterface{
				TonCocoonWorker,
			},
		},
		{
			name:    "cocoon wallet",
			account: "EQAJHTejCFK3mWMxkmZpA7oh89xSdLNWKAV9u1yj48JDCWz5",
			code:    "",
			data:    "b5ee9c7201010101005000009b0000000e00000000b04f495dd705f11c1d53cfae6ea9665b6cab3c2c6d1de55a441b20efca81df3300000000801cf2d92ae46c8da46ab425cd6bd2c8df012a80d8d7e09fe29111cba0f077ec66d0",
			want: []ContractInterface{
				TonCocoonWallet,
			},
		},
		{
			name:    "stonfi pool",
			account: "0:0A95E1D4EBE7860D051F8B861730DBDEE1440FD11180211914E0089146580351",
			code:    "",
			data:    "",
			want: []ContractInterface{
				TonStonfiV1Pool,
			},
		},
		{
			name:       "stonfi v2 const product",
			account:    "EQCGScrZe1xbyWqWDvdI6mzP-GAcAWFv6ZXuaJOuSqemxku4",
			code:       "b5ee9c7201010101002300084202a9338ecd624ca15d37e4a8d9bf677ddc9b84f0e98f05f2fb84c7afe332a281b4",
			data:       "",
			hasLibrary: true,
			want: []ContractInterface{
				TonTep74JettonMinter, TonStonfiV2PoolConstProduct,
			},
		},
		{
			name:       "stonfi v2 stableswap",
			account:    "EQBSUY4UWGJFAps0KwHY4tpOGqzU41DZhyrT8OuyAWWtnezy",
			code:       "b5ee9c72010101010023000842023c882eb9ede6be2459b2d2e469680af9f8e48ab16ec0726f0d07b0e5686be718",
			data:       "",
			hasLibrary: true,
			want: []ContractInterface{
				TonTep74JettonMinter, TonStonfiV2PoolStableSwap,
			},
		},
		{
			name:       "stonfi v2 weighted stableswap",
			account:    "EQAF6mNbKhaMrfyhdNcrEnRKW1fXA3jmkS6KM7azm9PunYx5",
			code:       "b5ee9c72010101010023000842029e5038ab735973d5450fae1a14e7707b332dcd8e744f5dbb3b6a0d994d400c59",
			data:       "",
			hasLibrary: true,
			want: []ContractInterface{
				TonTep74JettonMinter, TonStonfiV2PoolWeightedStableSwap,
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			codeBytes, _ := hex.DecodeString(tt.code)
			dataBytes, _ := hex.DecodeString(tt.data)
			codeCell, _ := boc.DeserializeBoc(codeBytes)
			dataCell, _ := boc.DeserializeBoc(dataBytes)
			account := ton.MustParseAccountID(tt.account)
			emulatorConfig := tt.emulatorConfig
			if tt.emulatorConfig == nil {
				emulatorConfig = boc.MustDeserializeSinglRootBase64(txemulator.DefaultConfig)
			}
			cli, err := liteapi.NewClient(liteapi.Testnet())
			if err != nil {
				t.Fatalf("failed to create liteapi client: %v", err)
			}
			ci := NewContractInspector(InspectWithLibraryResolver(cli))
			emulator, err := tvm.NewEmulator(codeCell[0], dataCell[0], emulatorConfig, tvm.WithLibraryResolver(cli))
			if err != nil {
				t.Fatalf("NewEmulator() failed: %v", err)
			}
			if tt.hasLibrary {
				if !codeCell[0].IsLibrary() {
					t.Fatal("code cell is not library cell")
				}
				libHash, err := codeCell[0].GetLibraryHash()
				if err != nil {
					t.Fatalf("NewEmulator() failed: %v", err)
				}
				libs, err := cli.GetLibraries(context.Background(), []ton.Bits256{libHash})
				if err != nil {
					t.Fatalf("GetLibraries() failed: %v", err)
				}
				base64Libs, err := code.LibrariesToBase64(libs)
				if err != nil {
					t.Fatalf("LibrariesToBase64() failed: %v", err)
				}
				emulator, err = tvm.NewEmulator(codeCell[0], dataCell[0], emulatorConfig, tvm.WithLibraryResolver(cli), tvm.WithLibrariesBase64(base64Libs))
				if err != nil {
					t.Fatalf("NewEmulator() with library failed: %v", err)
				}
			}
			contractDescription, err := ci.InspectContract(context.Background(), codeBytes, emulator, account)
			if err != nil {
				t.Fatalf("InspectContract() failed: %v", err)
			}

			if !reflect.DeepEqual(contractDescription.ContractInterfaces, tt.want) {
				t.Errorf("InspectContract() got = %v, want %v", contractDescription.ContractInterfaces, tt.want)
			}
			if tt.wantValidate != nil {
				if err = tt.wantValidate(contractDescription); err != nil {
					t.Fatalf("wantValidate() failed: %v", err)
				}
			}
			for _, method := range contractDescription.GetMethods {
				fmt.Printf("%v -> %#v\n", method.TypeHint, method.Result)
			}
		})
	}
}

func Test_getCodeInfo(t *testing.T) {
	tests := []struct {
		name        string
		code        string
		wantHash    string
		wantMethods map[int64]struct{}
	}{
		{
			code:     "",
			wantHash: "feb5ff6820e2ff0d9483e7e0d62c817d846789fb4ae580c878866d959dabd5c0",
			wantMethods: map[int64]struct{}{
				0: {}, 76407: {}, 78748: {}, 81467: {}, 85143: {}, 107653: {}, 524287: {},
			},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			code, err := hex.DecodeString(tt.code)
			if err != nil {
				t.Fatalf("hex.DecodeString() failed: %v", err)
			}
			got, err := GetCodeInfo(context.Background(), code, nil)
			if err != nil {
				t.Fatalf("GetCodeInfo() failed: %v", err)
			}
			if got.Hash.Hex() != tt.wantHash {
				t.Fatalf("GetCodeInfo() got = %v, want %v", got.Hash.Hex(), tt.wantHash)
			}
			if !reflect.DeepEqual(got.Methods, tt.wantMethods) {
				t.Errorf("GetCodeInfo() got = %v, want %v", got.Methods, tt.wantMethods)
			}
		})
	}
}
